/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import Menu from "../../menu/menu";
import { Form, Container } from "./styles";
import api from "../../../services/api";


class keepUnity extends Component {
    constructor(props) {
        super(props);
        this.state = {
            TIPO_DESC: null,
            DATA_ALTERACAO: null,
            info: [],
            item: [],
        };
    }
    componentDidMount = () => {
        // console.log("Data", this.state.data);
        this.history();
        // this.pendentGroup();
    }

    handleSubmit = async (e) => {
        e.preventDefault();
        const { local, setor } = this.state;
        // console.log(`Validacao ${linha}, ${user_group_id.value}, ${tipo_linha}, ${data_envio_nova}, ${status}`)
        if (!local) {
            alert("Favor Preencher o Local!");
        } else {
            try {
                let dest_setor = setor === null  ? 'Sem Setor' : setor;
                // const post = 
                await api.post("/setlocal", { descricao_local:local});
                await api.post("/setsetor", { descricao_setor:dest_setor});
                // const { data } = post;
                alert(`Unidade ${local} - ${dest_setor} cadastrado com sucesso!`);
                this.props.history.push("/app/unidade");
                this.history();
                // this.setState( state => ({info: [ data, ...state.info ]}));

            } catch (err) {
                console.log(err);
                alert("Ocorreu um erro ao registrar o ramal");
            }
        }
    }

    history = async (e) => {
        const response = await api.get(`/type`);
        const { data } = response;
        // console.log('History', data);
        this.setState({ info: data });
    }


    handleCheckboxChange(e) {
        const item = e.target.name;
        const isChecked = e.target.checked;
        this.setState(prevState => ({ checkedItems: prevState.checkedItems.set(item, isChecked) }));

    }

    render() {
        const { info } = this.state;
        // console.log("Info", info, groupSelected);

        return (
            <div className="mainDiv">
                <div className="menu">
                    <Menu />
                </div>
                <p>Manter Tipo de Ligações</p>
                <div className="formExt">
                    <Container>

                        <Form onSubmit={this.handleSubmit}>
                            <a>Local</a>
                            <input
                                type="text"
                                placeholder="Local"
                                onChange={e => this.setState({ local: e.target.value })}
                                required
                            />
                            <a>Setor</a>
                            <input
                                type="text"
                                placeholder="Setor"
                                onChange={e => this.setState({ setor: e.target.value })}
                            />
                            <button type="submit">Cadastrar</button>
                        </Form>

                        <div className="groups">
                            <div className="table">
                                <table>
                                    <thead>
                                        <tr>
                                            <th>ID</th>
                                            <th>TIPO</th>
                                            <th>DATA DE CADASTRO</th>
                                            <th>REMOVER</th>
                                        </tr>
                                    </thead>

                                    <tbody>
                                        {info.map(data => (
                                            <tr key={data.ID}>
                                                <td>{data.ID}</td>
                                                <td>{data.TIPO}</td>
                                                <td>{data.DATA_ALTERACAO}</td>
                                                <td><Checkbox
                                                    className="check"
                                                    name={data.ID}
                                                    checked={this.state.checkedItems.get(data.ID)}
                                                    onChange={this.handleCheckboxChange} />
                                                    <label>Remover</label>
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                                <div className="finders">
                                    <button className="findButton" onClick={this.deleteType}>Remover</button>
                                </div>
                            </div>

                        </div>
                    </Container>
                </div>
            </div>

        )
    }
}

export default withRouter(keepUnity);
